	public static LinkedList<Plan> getPlans()
	{
		LinkedList<Plan> returnedPlans = new LinkedList<Plan>();
		TermConstant.initialize(107);

		Domain d = new rover();

		d.setProblemConstants(defineConstants());

		State s = new State(36, d.getAxioms());

		JSHOP2.initialize(d, s);

		TaskList tl;
		SolverThread thread;

		createState0(s);

		tl = new TaskList(3, false);
		tl.subtasks[0] = new TaskList(new TaskAtom(new Predicate(4, 0, new TermList(TermConstant.getConstant(65), TermList.NIL)), false, false));
		tl.subtasks[1] = new TaskList(new TaskAtom(new Predicate(5, 0, new TermList(TermConstant.getConstant(80), TermList.NIL)), false, false));
		tl.subtasks[2] = new TaskList(new TaskAtom(new Predicate(6, 0, new TermList(TermConstant.getConstant(61), TermList.NIL)), false, false));

		thread = new SolverThread(tl, 1);
		thread.start();

		try {
			while (thread.isAlive())
				Thread.sleep(500);
		} catch (InterruptedException e) {
		}

		returnedPlans.addAll( thread.getPlans() );

		return returnedPlans;
	}

	public static LinkedList<Predicate> getFirstPlanOps() {
		return getPlans().getFirst().getOps();
	}
